package model;import java.sql.Date;public class RezervareInregistrare {    private int nrInregistrari;    private Date dataInregistrare;    public int getNrInregistrari() {        return nrInregistrari;    }    public void setNrInregistrari(int nrInregistrari) {        this.nrInregistrari = nrInregistrari;    }    public Date getDataInregistrare() {        return dataInregistrare;    }    public void setDataInregistrare(Date dataInregistrare) {        this.dataInregistrare = dataInregistrare;    }}